import Layout from '../components/layout';
import Head from 'next/head';
import Link from 'next/link';

const IndexPage = () => (
  <>
    <Head>
      <title>Simone's Bar</title>
      <link href='/public/global.css' rel='stylesheet' />
    </Head>
    <Layout>Hello</Layout>
  </>
);

export default IndexPage;
